import React from 'react';
import ReactDOM   from 'react-dom';

const element=<h>Hellow World</h>;
console.log(element);

ReactDOM.render(element,document.getElementById("root"));
//var scoped to function
//let is scoped to block
//const is to declare constant scoped is block readonly
// this is special keyword 
//function are object with bind methid we can bind this is based on value we are passing

class Person{
    constructor(name)
    {
        this.name=name;
    }
    walk()
    {
        console.log("walk");
    }
}
